const enumNoteSize = {
    [shapez.defaultBuildingVariant]: "Normal", // 2x1
    Single: "Single",   // 1x1
    Normal: "Normal",   // 2x1
    Large:  "Large",    // 2x2
    Long:   "Long",     // 3x1
};

const cachedResult = {};

function parseCurlyBraces(inputString) {
    // Check if the parsed result for this input string is already cached.
    if (cachedResult[inputString]) {
      return cachedResult[inputString];
    }
    // Initialize variables.
    let insideCurlyBraces = false;
    let substrings = [];
    let currentSubstring = "";
    // Iterate over each character in the input string.
    for (let character of inputString) {
      if (character !== "{" || insideCurlyBraces) {
        // If the current character is not a "{", or we are already inside curly braces,
        // add the character to the current substring.
        if (character === "}" && insideCurlyBraces) {
          // If the current character is a "}" and we are inside curly braces,
          // add the current substring plus the "}" character to the substrings array,
          // and reset the current substring and insideCurlyBraces flag.
          substrings.push(currentSubstring + "}");
          currentSubstring = "";
          insideCurlyBraces = false;
        } else {
          // If the current character is not a "}" or we are not inside curly braces,
          // add the character to the current substring.
          currentSubstring += character;
        }
      } else {
        // If the current character is a "{" and we are not inside curly braces,
        // add the current substring to the substrings array,
        // set insideCurlyBraces flag to true, and reset the current substring.
        substrings.push(currentSubstring);
        insideCurlyBraces = true;
        currentSubstring = "{";
      }
    }
    // Add the final substring to the substrings array if it is not empty.
    if (currentSubstring !== "") {
      substrings.push(currentSubstring);
    }
    // Cache the result for this input string and return the substrings array.
    cachedResult[inputString] = substrings.filter(substring => substring);
    return cachedResult[inputString];
};

function isValidColor(color) {
    const colors = ["black", "red", "green", "blue", "cyan", "purple", "yellow", "white", "grey"];
    return colors.includes(color);
};

function isHexColor(str) {
	return /^#?([0-9a-fA-F]{3}|[0-9a-fA-F]{6})$/.test(str);
};

function isValidBool(value) {
    const values = ["0", "1", "true", "false", "error"];
    return values.includes(value);
};

////////////////////////////////////////////////////////////////////////
class MetaNoteBuilding extends shapez.ModMetaBuilding {
    constructor() {
        super("PnmodNoteBuilding");
    }

    static getAllVariantCombinations() {
        return [
            {
                name: "Text display",
                description: "(1x1) Small display. You can change the color or set conditions to display different values with multiple {tags}.",
                variant: shapez.defaultBuildingVariant,

                regularImageBase64: RESOURCES.pnmod1x1,
                blueprintImageBase64: RESOURCES.pnmod1x1,
                tutorialImageBase64: RESOURCES.tutorial_text,
            },{
                name: "Text display",
                description: "(2x1) Normal display. You can change the color or set conditions to display different values with multiple {tags}.",
                variant: enumNoteSize.Normal,

                regularImageBase64: RESOURCES.pnmod2x1,
                blueprintImageBase64: RESOURCES.pnmod2x1,
                tutorialImageBase64: RESOURCES.tutorial_text,
            },{
                name: "Text display",
                description: "(2x2) Large display. You can change the color or set conditions to display different values with multiple {tags}.",
                variant: enumNoteSize.Large,

                regularImageBase64: RESOURCES.pnmod2x2,
                blueprintImageBase64: RESOURCES.pnmod2x2,
                tutorialImageBase64: RESOURCES.tutorial_text,
            },{
                name: "Text display",
                description: "(3x1) Wide display. You can change the color or set conditions to display different values with multiple {tags}.",
                variant: enumNoteSize.Long,

                regularImageBase64: RESOURCES.pnmod3x1,
                blueprintImageBase64: RESOURCES.pnmod3x1,
                tutorialImageBase64: RESOURCES.tutorial_text,
            },
        ];
    }

    getAvailableVariants(root) {
        return [shapez.defaultBuildingVariant, enumNoteSize.Normal, enumNoteSize.Large, enumNoteSize.Long];
    }

    updateVariants(entity, rotationVariant, variant) {
        const noteSize = enumNoteSize[variant];
        entity.components.PnmodNote.NoteSize = noteSize;
    }

    getSilhouetteColor() {
        return "#E3FBFF";
    }

    getDimensions(variant) {
        switch (variant) {
            case shapez.defaultBuildingVariant:
                return new shapez.Vector(1, 1);
                break;
            case enumNoteSize.Single:
                return new shapez.Vector(1, 1);
                break;
            case enumNoteSize.Normal:
                return new shapez.Vector(2, 1);
                break;
            case enumNoteSize.Large:
                return new shapez.Vector(2, 2);
                break;
            case enumNoteSize.Long:
                return new shapez.Vector(3, 1);
                break;
            default:
                return new shapez.Vector(1, 1);
                break;
        }
    }

    getIsUnlocked(root) {
        return true;
    }

    setupEntityComponents(entity) {
        entity.addComponent( new shapez.WiredPinsComponent({ slots: [{
            pos: new shapez.Vector(0, 0),
            direction: shapez.enumDirection.top,
            type: shapez.enumPinSlotType.logicalAcceptor,
        }]}));
        entity.addComponent(new PnmodNoteComponent());
    }
};

////////////////////////////////////////////////////////////////////////
class PnmodNoteComponent extends shapez.Component {

    static getId() {
        return "PnmodNote";
    }

    static getSchema() {
        return {
            NoteText: shapez.types.string,
            NoteFontSize: shapez.types.int,
            NoteSize: shapez.types.string,
        };
    }

    constructor(noteSize = enumNoteSize.Normal) {
        super();
        this.NoteText = "";
        this.NoteFontSize = 8;
        this.NoteSize = noteSize;
    }

    copyAdditionalStateTo(otherComp) {
        otherComp.NoteText = this.NoteText;
        otherComp.NoteFontSize = this.NoteFontSize;
        otherComp.NoteSize = this.NoteSize;
      }
};


////////////////////////////////////////////////////////////////////////
class PnmodNoteSystem extends shapez.GameSystemWithFilter {
    constructor(root) {
        super(root, [PnmodNoteComponent]);

        // Ask for a notification text once an entity is placed
        this.root.signals.entityManuallyPlaced.add(entity => {
            const editorHud = this.root.hud.parts.PnmodNoteEdit;
            if (editorHud) {
                editorHud.editNoteText(entity, { deleteOnCancel: true });
            }
        });
    }

    drawChunk(parameters, chunk) {
        const contents = chunk.containedEntitiesByLayer.regular;
        for (let i = 0; i < contents.length; ++i) {
            const entity = contents[i];
            const PnmodNoteComp = entity.components.PnmodNote;
            if (!PnmodNoteComp) {
                continue;
            }

            const pinsComp = entity.components.WiredPins;
            const network = pinsComp.slots[0].linkedNetwork;

			const staticComp = entity.components.StaticMapEntity;
			const context = parameters.context;
			const center = staticComp.getTileSpaceBounds().getCenter().toWorldSpace();

			if (parameters.visibleRect.containsCircle(center.x, center.y, 40) && PnmodNoteComp.NoteText.length > 0) {
				
				let value = null;

				if (network && network.hasValue()) { 
					value = network.currentValue.getAsCopyableKey();
				}

				// Parse the input string into an array of substrings.
				let parsedInput = parseCurlyBraces(PnmodNoteComp.NoteText);

				// Check if any of the substrings represent a valid short key.
				let hasValidShortKey = parsedInput.some((substring) => {
					return (
						substring[0] === "{" &&
						substring[substring.length - 1] === "}" &&
						shapez.ShapeDefinition.isValidShortKey(substring.slice(1, -1)) ||
						substring[0] === "{" &&
						substring[substring.length - 1] === "}" &&
						isValidBool(substring.slice(1, -1)) ||
						substring[0] === "{" &&
						substring[substring.length - 1] === "}" &&
						substring.slice(1, -1) === "goal"
					);
				});

				let lastSubstringIsShortKey = false;
				let lastShortKeyValue = null;
				let lastColorKey = null;

				// Iterate over each substring in the parsed input.
				parsedInput.forEach((substring) => {
					if (substring[0] === "{" && substring[substring.length - 1] === "}") {
					// If the substring is surrounded by curly braces
					var subSlice = substring.slice(1, -1);
						if (shapez.ShapeDefinition.isValidShortKey(subSlice)) {
							// If the substring represents a valid short key
							lastSubstringIsShortKey = true;
							lastShortKeyValue = subSlice;
						} else if (isValidColor(subSlice) || isHexColor(subSlice)) {
							// If the substring represents a valid color key
							lastColorKey = subSlice;
						} else if (isValidBool(subSlice)) {
							lastSubstringIsShortKey = true;
							if (subSlice == "1" || subSlice == "true") lastShortKeyValue = "1"; // shapez.BOOL_TRUE_SINGLETON;
							else if (subSlice == "error") lastShortKeyValue = "error";
							else lastShortKeyValue = "0"; // shapez.BOOL_FALSE_SINGLETON;
							if (network) {
								if (network.hasValue()) {
									if (shapez.isTruthyItem(network.currentValue)) value = "1";
									else if (network.currentValue === shapez.BOOL_FALSE_SINGLETON) value = "0";
									else value = null;
								}
								else if (network.valueConflict) value = "error";
								else value = null;
							}
						} else if (subSlice === "goal") {
							lastSubstringIsShortKey = true;
							lastShortKeyValue = this.root.hubGoals.currentGoal.definition.getHash();
						}
					} else {
					// If the substring is NOT surrounded by curly braces
						if (!hasValidShortKey || (lastSubstringIsShortKey && lastShortKeyValue === value)) {
							// Display the text
							var lines = substring.split("//");
							for (var ln = 0; ln < lines.length; ln++) {
								if (lastColorKey) {
									context.fillStyle = lastColorKey;
								} else {
									context.fillStyle = "white";
								}
								context.textAlign = "center";
								if (lines.length > 1) {
									context.font = "bold " + PnmodNoteComp.NoteFontSize + "px GameFont";
									context.fillText(lines[ln], center.x, center.y + (PnmodNoteComp.NoteFontSize * ln) - (PnmodNoteComp.NoteFontSize * 0.5 * (lines.length - 1)) + (PnmodNoteComp.NoteFontSize * 0.25)); // if 3 lines, move them all up by one
								} else {
									context.font = "bold " + PnmodNoteComp.NoteFontSize + "px GameFont";
									context.fillText(lines[ln], center.x, center.y + (PnmodNoteComp.NoteFontSize * ln) + (PnmodNoteComp.NoteFontSize * 0.25));
								}
							}
						}
						lastSubstringIsShortKey = false;
						lastShortKeyValue = null;
						lastColorKey = null;
					}
				});  
			}
        }
    }
};

////////////////////////////////////////////////////////////////////////
// HUD Component to be able to edit notification blocks by clicking them
class HUDPnmodNoteEdit extends shapez.BaseHUDPart {
    initialize() {
        this.root.camera.downPreHandler.add(this.downPreHandler, this);
    }

    /**
     * @param {Vector} pos
     * @param {enumMouseButton} button
     */
    downPreHandler(pos, button) {

        const tile = this.root.camera.screenToWorld(pos).toTileSpace();
        const contents = this.root.map.getLayerContentXY(tile.x, tile.y, "regular");
        if (contents) {
            const PnmodNoteComp = contents.components.PnmodNote;
            if (PnmodNoteComp) {
                if (button === shapez.enumMouseButton.left) {
                    this.editNoteText(contents, {
                        deleteOnCancel: false,
                    });
                    return shapez.STOP_PROPAGATION;
                }
            }
        }
    }

    /**
     * Asks the player to enter a notification text
     * @param {Entity} entity
     * @param {object} param0
     * @param {boolean=} param0.deleteOnCancel
     */
    editNoteText(entity, { deleteOnCancel = true }) {
        const PnmodNoteComp = entity.components.PnmodNote;
        if (!PnmodNoteComp) {
            return;
        }

        // save the uid because it could get stale
        const uid = entity.uid;

        // create an input field to query the text
        const strInput = new shapez.FormElementInput({
            id: "NoteText",
			label: "Content:",
            placeholder: "{0}{red}Off{1}{#60e340}On",
            defaultValue: PnmodNoteComp.NoteText,
            validator: val => val.length >= 0,
        });

        const intInput = new shapez.FormElementInput({
            id: "NoteFontSize",
			label: "Font size:",
            placeholder: "8",
            defaultValue: PnmodNoteComp.NoteFontSize.toString(),
            validator: val => val.length > 0 && parseInt(val) >= 4 && parseInt(val) <= 32,
        });

        // create the dialog & show it
        const dialog = new shapez.DialogWithForm({
            app: this.root.app,
            title: shapez.T.mods.PnmodNote.dialogTitle,
            desc: shapez.T.mods.PnmodNote.dialogText,
            formElements: [strInput, intInput],
            buttons: ["cancel:bad:escape", "ok:good:enter"],
            closeButton: false,
        });
        this.root.hud.parts.dialogs.internalShowDialog(dialog);

        // When confirmed, set the text
        dialog.buttonSignals.ok.add(() => {
            if (!this.root || !this.root.entityMgr) {
                return;
            }

            const entityRef = this.root.entityMgr.findByUid(uid, false);
            if (!entityRef) {
                return;
            }

            const PnmodNoteComp = entityRef.components.PnmodNote;
            if (!PnmodNoteComp) {
                return;
            }

            // set the values
            PnmodNoteComp.NoteText = strInput.getValue();
            PnmodNoteComp.NoteFontSize = parseInt(intInput.getValue());
        });

        // When cancelled, destroy the entity again
        if (deleteOnCancel) {
            dialog.buttonSignals.cancel.add(() => {
                if (!this.root || !this.root.entityMgr) {
                    return;
                }

                const entityRef = this.root.entityMgr.findByUid(uid, false);
                if (!entityRef) {
                    return;
                }

                const PnmodNoteComp = entityRef.components.PnmodNote;
                if (!PnmodNoteComp) {
                    return;
                }

                this.root.logic.tryDeleteBuilding(entityRef);
            });
        }
    }
};

////////////////////////////////////////////////////////////////////////
class Mod extends shapez.Mod {
    init() {
        ////////////////////////////////////////////////////////////////////////
        // PNMOD BUTTON

        if (!shapez.enumLeverVariants)
        shapez.enumLeverVariants = new Object;
        shapez.enumLeverVariants.big = "big";

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaLeverBuilding,
            shapez.enumLeverVariants.big,
            {
                name: "Rocker switch",
                description: "A big 1x2 switch for my bad eyesight.",

                tutorialImageBase64: RESOURCES.switch_tutorial,
                regularSpriteBase64: RESOURCES.switch_o,
                blueprintSpriteBase64: RESOURCES.switch_i,

                dimensions: new shapez.Vector(2, 1),

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_wires_painter_and_levers);
                },

            }
        );

        this.modInterface.extendClass(shapez.MetaLeverBuilding, ({$old}) => ({
			updateVariants(entity, rotationVariant, variant) {

				entity.components.Lever.root = entity.root;
				if (variant === "big") {
					entity.components.WiredPins.setSlots([
						{ pos: new shapez.Vector(0,0), direction: shapez.enumDirection.left, type: shapez.enumPinSlotType.logicalEjector },
					]);
                    entity.components.Lever.isBig = true;
				} else {
					entity.components.WiredPins.setSlots([
						{ pos: new shapez.Vector(0,0), direction: shapez.enumDirection.top, type: shapez.enumPinSlotType.logicalEjector },
					]);
                    entity.components.Lever.isBig = false;
					$old.updateVariants.bind(this)(
						entity,
						rotationVariant,
						variant
					);
				}
			},
		}));

        this.modInterface.registerSprite("sprites/buildings/switchi.png", RESOURCES.switch_i);
        this.modInterface.registerSprite("sprites/buildings/switcho.png", RESOURCES.switch_o);
        
        this.modInterface.extendClass(shapez.LeverSystem, ({ $super, $old }) => ({
            drawChunk(parameters, chunk) {
                this.spriteOn1 = shapez.Loader.getSprite("sprites/buildings/switchi.png");
                this.spriteOff1 = shapez.Loader.getSprite("sprites/buildings/switcho.png");
                const contents = chunk.containedEntitiesByLayer.regular;
                for (let i = 0; i < contents.length; ++i) {
                    const entity = contents[i];
                    const leverComp = entity.components.Lever;
                    if (leverComp) {
                        if (leverComp.isBig) {
                            const sprite = leverComp.toggled ? this.spriteOn1 : this.spriteOff1;
                            entity.components.StaticMapEntity.drawSpriteOnBoundsClipped(parameters, sprite);
                        } else {
                            const sprite = leverComp.toggled ? this.spriteOn : this.spriteOff;
                            entity.components.StaticMapEntity.drawSpriteOnBoundsClipped(parameters, sprite);
                        }
                    }
                }
            },
        }));

        ////////////////////////////////////////////////////////////////////////
        // PNMOD DISPLAY
        if (!shapez.enumDisplayVariants)
        shapez.enumDisplayVariants = new Object;
        shapez.enumDisplayVariants.pnmodlarge = "pnmodlarge";

        this.modInterface.registerSprite(`sprites/buildings/display.png`, RESOURCES.pnmod1x1);

        this.modInterface.addVariantToExistingBuilding(
            shapez.MetaDisplayBuilding,
            shapez.enumDisplayVariants.pnmodlarge,
            {
                name: "Large Display",
                description: "Connect to network to display its signal.",

                tutorialImageBase64: RESOURCES.tutorial_display,
                regularSpriteBase64: RESOURCES.pnmod2x2,
                blueprintSpriteBase64: RESOURCES.pnmod2x2,

                dimensions: new shapez.Vector(2, 2),

                isUnlocked(root) {
                    return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_display);
                },

            }
        );

        this.modInterface.extendClass(shapez.MetaDisplayBuilding, ({$old}) => ({
			updateVariants(entity, rotationVariant, variant) {

				entity.components.Display.root = entity.root;
				if (variant === "pnmodlarge") {
					entity.components.WiredPins.setSlots([
						{ pos: new shapez.Vector(0,1), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
					]);
					entity.components.Display.isLarge = true;
				} else {
					entity.components.WiredPins.setSlots([
						{ pos: new shapez.Vector(0,0), direction: shapez.enumDirection.bottom, type: shapez.enumPinSlotType.logicalAcceptor },
					]);
                    entity.components.Display.isLarge = false;
					$old.updateVariants.bind(this)(
						entity,
						rotationVariant,
						variant
					);
				}
			},
		}));

        this.modInterface.extendClass(shapez.DisplaySystem, ({ $super, $old }) => ({
			drawChunk(parameters, chunk) {
                const contents = chunk.containedEntitiesByLayer.regular;
                for (let i = 0; i < contents.length; ++i) {
                    const entity = contents[i];
                    if (entity && entity.components.Display) {
                        const pinsComp = entity.components.WiredPins;
                        const network = pinsComp.slots[0].linkedNetwork;
        
                        if (!network || !network.hasValue()) {
                            continue;
                        }

                        let value = network.currentValue;
                        if (!value) {
                            continue;
                        }

                        if (entity.components.Display.isLarge) {
                            const origin = entity.components.StaticMapEntity.origin;
                            if (value.getItemType() === "color" || value.getItemType() === "shape" || value.getItemType() === "boolean" && shapez.isTrueItem(value)) {
                                value.drawItemCenteredClipped(
                                    (origin.x + 1) * shapez.globalConfig.tileSize,
                                    (origin.y + 1) * shapez.globalConfig.tileSize,
                                    parameters,
                                    50
                                );
                            }
                        } else {
                            value = this.getDisplayItem(value);
                            if (!value) {
                                continue;
                            }
                            const origin = entity.components.StaticMapEntity.origin;
                            if (value.getItemType() === "color") {
                                this.displaySprites[/** @type {ColorItem} */ (value).color].drawCachedCentered(
                                    parameters,
                                    (origin.x + 0.5) * shapez.globalConfig.tileSize,
                                    (origin.y + 0.475) * shapez.globalConfig.tileSize,
                                    shapez.globalConfig.tileSize*0.75
                                );
                            } else if (value.getItemType() === "shape") {
                                value.drawItemCenteredClipped(
                                    (origin.x + 0.5) * shapez.globalConfig.tileSize,
                                    (origin.y + 0.475) * shapez.globalConfig.tileSize,
                                    parameters,
                                    25
                                );
                            }
                        }
                    }
                }
            }
		}));

        ////////////////////////////////////////////////////////////////////////
        // PNMOD TEXT DISPLAY
        this.modInterface.registerComponent(PnmodNoteComponent);

        this.modInterface.registerNewBuilding({
            metaClass: MetaNoteBuilding,
            buildingIconBase64: RESOURCES.icon,
        });

        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaNoteBuilding,
        });

		this.modInterface.addNewBuildingToToolbar({
            toolbar: "wires",
            location: "secondary",
            metaClass: MetaNoteBuilding,
        });

        this.modInterface.registerGameSystem({
            id: "PnmodNote",
            systemClass: PnmodNoteSystem,
            before: "constantSignal",
            drawHooks: ["staticAfter"],
        });

        this.modInterface.registerHudElement("PnmodNoteEdit", HUDPnmodNoteEdit);

        this.modInterface.registerTranslations("en", LANG_EN);
    }
};

